void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
	bool is_steep = abs(y1 - y0) > abs(x1 - x0);
	
	if (is_steep) { 
		int t = x0;
		x0 = y0;
		y0 = t;
		
		t = x1;
		x1 = y1;
		y1 = t; 
	}
	
	if (x0 > x1) { 
		int temp = x0;
		x0 = x1;
		x1 = temp;
		temp = y0;
		y0 = y1;
		y1 = temp;
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;
	int y_step;
	
	if (y0 < y1) {
		y_step = 1;
	} else {
		y_step = -1;
	}
	 
	int x;
	for (x = x0; x <= x1; x++) {
		if (is_steep) {
			plot_pixel(y, x, line_color);
		} else {
			plot_pixel(x, y, line_color);
		}

		error = error + deltay;
		if (error > 0) {
			y = y + y_step;
			error = error - deltax;
		}	
	}
}

